import React from "react";
import Input from "../components/Input";

export default function Contact() {
  return (
    <div className="mt-5">
      <div className="text-white">
        <h1 className="text-center">Contact Form</h1>
      </div>
      <div className="row">
        <div className="col-8">
          <Input />
        </div>
        <div className="col-4">
          <h1>Maps</h1>
        </div>
      </div>
    </div>
  );
}
